function duplicatePoints(points, times = 3) {
  const result = [];
  for (const p of points) {
    for (let i = 0; i < times; i++) {
      result.push({
        x: p.x + Math.random() * 0.5,
        y: p.y + Math.random() * 0.5
      });
    }
  }
  return result;
}

function createParticles(points, color) {
  return points.map(p => {
    return {
      x: canvas.width / 2,
      y: canvas.height / 2,
      vx: (Math.random() - 0.5) * 20,
      vy: (Math.random() - 0.5) * 20,
      tx: p.x * scale + offsetX,
      ty: p.y * scale + offsetY,
      color,
      forming: false
    };
  });
}
const cParticles = createParticles(duplicatePoints(cPoints, 0.00000000000000000000000001), "#00ff00"); // verde
const fParticles = createParticles(duplicatePoints(fPoints, 0.000001), "#000000"); // preto


const particles = [...cParticles, ...fParticles ];

let time = 0;
function animate() {
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  time++;

  particles.forEach(p => {
    if (time < 80) {
      p.x += p.vx;
      p.y += p.vy;
    } else {
      p.x += (p.tx - p.x) * 0.02;
      p.y += (p.ty - p.y) * 0.02;
    }

    ctx.fillStyle = p.color;
    ctx.beginPath();
    ctx.arc(p.x, p.y, 4, 0, Math.PI * 2);
    ctx.fill();
  });

  requestAnimationFrame(animate);
}

animate();
